import React, { useState, useEffect } from 'react';
import { useAuth0 } from '@auth0/auth0-react';
import { Button, Dropdown } from 'react-bootstrap';

const HomePage = () => {
  const { isAuthenticated, loginWithRedirect, logout, user } = useAuth0(); // Access user information from useAuth0 hook
  const [showDropdown, setShowDropdown] = useState(false); // State to control visibility of plus icon dropdown
  const [showUserDropdown, setShowUserDropdown] = useState(false); // State to control visibility of user avatar dropdown

  // Function to toggle visibility of plus icon dropdown
  const toggleDropdown = () => {
    setShowDropdown(!showDropdown);
  };

  // Function to toggle visibility of user avatar dropdown
  const toggleUserDropdown = () => {
    setShowUserDropdown(!showUserDropdown);
  };

  useEffect(() => {
    // Load FontAwesome CSS
    const link = document.createElement('link');
    link.href = "https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css";
    link.rel = "stylesheet";
    document.head.appendChild(link);

    return () => {
      // Cleanup on unmount
      document.head.removeChild(link);
    };
  }, []);



  return (
    <div>
      {/* Navbar */}
      <nav className="navbar">
        <div className="container">
          <div className="navbar-brand">
            <img src="C:\Users\Dell\OneDrive\Desktop\Demo\miniprojectsem6\src\images\logo.png" alt="Bootstrap" width="50" height="50" />
            <span className="brand-name" sx={{ fontSize: 50 }}>EzOuiz</span>
          </div>
          <div className="navbar-icons">
  {/* Plus Icon Dropdown */}
  {!isAuthenticated && (
    <div className="dropdown">
      <button className="btn btn-link dropdown-toggle" type="button" id="dropdown-basic" onClick={toggleDropdown}>
        <i className="fas fa-plus" style={{ color: 'white' }}></i>
      </button>
      <ul className={`dropdown-menu${showDropdown ? ' show' : ''}`} aria-labelledby="dropdown-basic">
        <li><a className="dropdown-item" href="#">Option 1</a></li>
        <li><a className="dropdown-item" href="#">Option 2</a></li>
        {/* Add more options as needed */}
      </ul>
    </div>
  )}
  {/* User Avatar Dropdown */}
  {isAuthenticated && (
    <div className="dropdown">
      <button className="btn btn-link dropdown-toggle" type="button" id="user-dropdown" onClick={toggleUserDropdown}>
        <img src={user.picture} alt={user.name} style={{ width: 35, height: 35, borderRadius: 50 }} />
      </button>
      <ul className={`dropdown-menu${showUserDropdown ? ' show' : ''}`} aria-labelledby="user-dropdown">
        <li><a className="dropdown-item" href="#">Profile</a></li>
        <li><a className="dropdown-item" href="#">Settings</a></li>
        <div className="dropdown-divider"></div>
        <li><a className="dropdown-item" href="#" onClick={() => logout({ returnTo: window.location.origin })}>Logout</a></li>
      </ul>
    </div>
  )}
  {/* Login Button */}
  {!isAuthenticated && <button className="btn btn-primary" onClick={loginWithRedirect}>Log In</button>}
</div>

        </div>
      </nav>

      {/* Your existing content */}
      <div className='container-fluid'>
        <h1 style={{ textAlign: 'center' }}>Welcome to the EzQuiz </h1>
        {isAuthenticated && (
          <div>
            {/* Dashboard with options for enrolled classes, create class, etc. */}
          </div>
        )}
      </div>
    </div>
  );

}

export default HomePage;

// CSS for navbar styles
const styles = `
/* Navbar styles */
.navbar {
  background-color: white; /* Change the navbar background color to white */
  color: #000; /* Change the text color to black */
  padding: 10px 20px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  box-shadow: 0 2px 4px rgba(0, 0, 0, 1); /* Add light shadow to the bottom */
}

/* Brand name styles */
.brand-name {
  margin-left: 10px;
  font-size:25px;
  font-weight:500;
  color:white;
}

/* Navbar icons styles */
.navbar-icons {
  display: flex;
  align-items: center;
}

/* Plus icon styles */
.icon-btn {
  background-color: transparent;
  border: none;
  font-size: 18px;
  cursor: pointer;
  margin-left: 10px;
}

/* User avatar styles */
.avatar {
  width: 30px;
  height: 30px;
  border-radius: 50%;
  margin-left: 10px;
  cursor: pointer;
}

/* Media queries for responsiveness */
@media screen and (max-width: 768px) {
  /* Adjust styles for smaller screens */
  .navbar {
    flex-direction: column;
    align-items: flex-start;
  }
  
  .brand-name {
    margin-left: 0;
    margin-top: 10px;
  }
  
  .navbar-icons {
    margin-top: 10px;
  }
}
`;

// Inject the CSS styles into the document
const styleElement = document.createElement('style');
styleElement.appendChild(document.createTextNode(styles));
document.head.appendChild(styleElement);
